import createReactComponent from "../createReactComponent";
import defaultAttributes from "../defaultAttributes";
var Trello = createReactComponent("Trello", ["svg", defaultAttributes, [["rect", {
  x: "3",
  y: "3",
  width: "18",
  height: "18",
  rx: "2",
  ry: "2",
  key: "1sylwi"
}], ["rect", {
  x: "7",
  y: "7",
  width: "3",
  height: "9",
  key: "1hysax"
}], ["rect", {
  x: "14",
  y: "7",
  width: "3",
  height: "5",
  key: "4yzqj6"
}]]]);
export default Trello;
